*
 * 获取客户端的皮肤状态 shuqi android only
 *
 * 支持平台：书旗Android
 *
 * @return {Promise.<void>}
 *
 * @example
 * const params = [
 * { id: '999', ver: '1.0' },
 * { id: '1028', ver: '1.0.1' },
 * { id: '1025', ver: '1.1' },
 * { id: '1013', ver: '1.2' },
 * { id: '1012', ver: '1.1' },
 * { id: '1010', ver: '1.9' },
 * { id: '1004', ver: '1.14' },
 * { id: '1000', ver: '1.19' },
 * { id: '1001', ver: '1.20' },
 * { id: '1003', ver: '1.20' },
 * { id: '1002', ver: '1.22' },
 * ];
 * libSQ.exec('get-skin-state', { params }).then((info) => {
 *    alert(`[get-skin-state][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *    alert(`[get-skin-state][error] ${JSON.stringify(err, null, 2)}`);
 * });
 *
 * 返回数据格式如下:
 *     {
 *          "code":200,
 *          "message":"success",
 *          "data":{
 *                    "code":200,
 *                     "message":"success",
 *                     "data":{
 *                           "{{id}}":{
 *                                "status":0,//1表示已下载，0表示未下载
 *                                 "ver":"xx" //该皮肤的版本号
 *                                  },
 *                           ...
 *                          }
 *                 }
 *      }

